from sklearn import metrics
from sklearn.metrics import roc_curve, auc, roc_auc_score, accuracy_score
import matplotlib.pyplot as plt

def plotROC(test1, pred1, test2, pred2, test3, pred3, test4, pred4, test5, pred5):
    """
    Plots roc curve
    :param pred_labels: List of predicted labels
    :param test_labels: List of true labels
    :return: ROC graph
    """
    roc_auc1 = roc_auc_score(test1, pred1)
    roc_auc2 = roc_auc_score(test2, pred2)
    roc_auc3 = roc_auc_score(test3, pred3)
    roc_auc4 = roc_auc_score(test4, pred4)
    roc_auc5 = roc_auc_score(test5, pred5)
    plt.title('Receiver Operating Characteristic')
    false_positive_rate1, true_positive_rate1, thresholds1 = roc_curve(test1, pred1)
    plt.plot(false_positive_rate1, true_positive_rate1, 'r', color="r", label='AUC* = %0.2f' % roc_auc1)
    false_positive_rate2, true_positive_rate2, thresholds2 = roc_curve(test2, pred2)
    plt.plot(false_positive_rate2, true_positive_rate2, 'b', color="b", label='AUC = %0.2f' % roc_auc2)
    false_positive_rate3, true_positive_rate3, thresholds3 = roc_curve(test3, pred3)
    plt.plot(false_positive_rate3, true_positive_rate3, 'g', color="g", label='AUC = %0.2f' % roc_auc3)
    false_positive_rate4, true_positive_rate4, thresholds4 = roc_curve(test4, pred4)
    plt.plot(false_positive_rate4, true_positive_rate4, 'm', color="m", label='AUC = %0.2f' % roc_auc4)
    false_positive_rate5, true_positive_rate5, thresholds5 = roc_curve(test5, pred5)
    plt.plot(false_positive_rate5, true_positive_rate5, 'c', color="c", label='AUC = %0.2f' % roc_auc5)
    plt.legend(loc='lower right')
    plt.plot([0, 1], [0, 1], 'k--')
    plt.xlim([-0.1, 1.2])
    plt.ylim([-0.1, 1.2])
    plt.ylabel('True Positive Rate')
    plt.xlabel('False Positive Rate')
    plt.show()


def getANNResults(test_labels, pred_labels):
    """
    Get number of maligne and benigne predicted labels
    :param labels: Labels
    :return: maligne, benigne : Number of maligne and benigne prediction
    """
    maligne_pred = 0
    benigne_pred = 0
    maligne_test = 0
    benigne_test = 0
    for pred in pred_labels:
        if pred == 1:
            maligne_pred+=1
        else:
            benigne_pred+=1
    for label in test_labels:
        if label == 1:
            maligne_test+=1
        else:
            benigne_test+=1
    return maligne_pred, benigne_pred, maligne_test, benigne_test

def getPositiveNegatves(test_labels, pred_labels):
    TP = 0
    FP = 0
    TN = 0
    FN = 0
    for i in range(0, len(pred_labels)):
        if pred_labels[i] == 1 and test_labels[i] == 1:
            TP = TP+1
        elif pred_labels[i] == 1 and test_labels[i] == 0:
            FP = FP+1
        elif pred_labels[i] == 0 and test_labels[i] == 0:
            TN = TN+1
        elif pred_labels[i] == 0 and test_labels[i] == 1:
            FN = FN+1
        else:
            print("ERROR")
    print("TP: ", TP," FP: ",FP," TN: ",TN," FN: ",FN)




def getAUC(test_labels, pred_labels):
    """
    Compute AUC of prediction
    :param pred_labels:
    :param test_labels:
    :return: roc_auc - AUC of prediction
    """
    false_positive_rate, true_positive_rate, thresholds = roc_curve(test_labels, pred_labels)
    roc_auc = roc_auc_score(test_labels, pred_labels)
    return roc_auc


